import React from 'react'

function Adressandtime() {
  return (
    <div className="adress">
        <div className="adressofwork"><span>办公地址</span><span> Avda. Republica Argentina, 19C, 1C 41011 Sevilla.</span></div>
        <div className="worktime"><span>工作时间</span><span> 17:00 – 20:00 <br/>周一至周五</span></div>
        <div className="findus"><span>联系我们</span><span> Avda. Republica Argentina, 19C, 1C 41011 Sevilla.</span></div>
    </div>

  )
}

export default Adressandtime
